import React from 'react';

import styles from './TileItem.module.css';

// { index, text, handleClick }
export default (props) => {
	console.log(props)
	return (
  	<li className={styles.row}> 
			<div className={styles.text}>
				{props.text}
			</div>
		</li>
	);
};

